import React from 'react';
import Footer from '../Footer';
import '../../App.css';

export default function Services() {
  return (
  <div>
  <div>
  <h1 className='services'>Services</h1>
  <h3>Advisory</h3>
  <p>We provide advisory services such as market feasibility studies, economic impact analysis, valuation analysis, financial projections, contractor/vendor selection opinions, tenant selection and other analyses that could support decision-making throughout all stages of the investment and development process. We are also a fully licensed real estate brokerage and are able to advise our clients in the real estate acquisition and sales process.</p>
  <p>For general inquiries or additional information regarding investment or collaboration opportunities, please click on the Contact Us button below.</p>
  </div>
  <Footer />
  </div>
)


}
